import { Chart, Tooltip, Axis, Legend, Pie, Coord, Line, Bar, Point} from 'viser-react';
import * as React from 'react';
import { Row, Col, Card, Button, Icon, Progress, Form , Modal, Table} from "antd";
import axios from "axios";
import ReactApexChart from 'react-apexcharts'
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';


import ChartBreakdownDonut from "./ChartBreakdownDonut";
import LineChart from "./LineChart";


const DataSet = require("@antv/data-set");



class ManagementAllCharts extends Component {
  constructor(props) {
    super(props);
    this.state = {
      chartData: [],
      selectedKey: "daily"
    };

  }
  render() {
    return (
      <div>
        <div id="content">
          <Row type="flex" gutter={24}>
            <Col xs={24} sm={24} md={{span: 12, order: 4}} lg={12} xl={{span:8, order: 5}} className="c-mb">
              <Card
                title="Breakdown"
                style={{ minHeight: "100%" }}
                bordered={false}
                className="mi-card mi-card-header-borderless mi-card-boxshadow"
              >
                <div>
                  <ChartBreakdownDonut />
                </div>
              </Card>
            </Col>
          </Row>

          <Row type="flex" gutter={24}>
          </Row>

        </div>
      </div>
    );
  }
}
export default ManagementAllCharts;
